import React, { useEffect, useState } from "react";
import "./App.css";

function App() {
  const list = ["Item 1", "Item 2", "Item 3", "Item 4"];
  return (
    <body className="App-body">
      {list.map((element) => `<div>${element}</div>`)}
    </body>
  );
}

export default App;
